  input: '"TEXT","F3A","C00397646","Our committee is in receipt of the letter from
    the Commission regarding our third quarter report, thank you for the opportunity
    to respond.  With respect to teh 48 hour notice mentioned, there was a miscommunication
    between the candidate and the campaign on the day this loan was made.  The correct
    amount is the one that was reported on the third quarter report, the amount on
    the 48 hour notice is actually $2000 higher than the actual loan amount.  Again,
    this was due to a miscommunication on the day the actual loan was made.  We were
    aware that there is no means available to amend a 48 hour notice so we realized
    that we would have to wait until this time to correct the public record.  Also,
    our committee filed a 24 hour, Form 10 notice for the loan dated 7-19-04.  We
    were under the impression that this immediate disclosure was sufficient and an
    additional report was not necessary.  We believed that because the loan was immediately
    disclosed and a part of the public record that no further action was needed.  All
    candidate loans made during this period were from personal funds.  A software
    limitation made this difficult to include, but we have worked around that issue
    and this is made very clear on this amendment.  This is the case with the loan
    due dates as well.  Please note the changes of these dates.  Please do not hesitate
    to contact us if any further information is needed.  Thank you, Patterson for
    Congress."'
